INSERT INTO `publications` (`Publication_id`, `title`, `pub_id`, `notes`, `pubdate`) VALUES
	('03LRBK', ' Democratizing Scrutiny as Aphoristically Constructed Mediators.', '0736', ' It is debatable that this will be recommended as the most educative publication on the subject, balancing as it does the resonance between memories and epistemology. with a nod to both Process Philosophy and Nihilism, it describes scrutiny as a site of plasticity.', '2000-05-10 20:55:02'),
	('04NAXO', ' Literary Justice as Divided Mediators.', '0877', ' This enlightening book evokes various gendered Ambivalences and their relation to Deontological Ethics: and the influence of the performing intertextuality depicts the gender perception representing heterotopian claims to progress.', '2004-01-06 02:08:06'),
	('05B4X1', ' Debating Play and the Gendering of Space in the Gilded Age.', '1389', ' The author educes neoliberalism and its relationship to the body in personal letters by JG Ballard, and traces nuanced, profound ruminations on topics from the mundane to the profound.', '2001-02-20 07:52:44'),
	('05XKTJ', ' Debating Play and the Gendering of Space in the Gilded Age.', '0877', ' following influences from experience, power and masochism, the dissertation narrates gendered Labor Migration through time', '2005-06-30 05:42:59'),
	('06KF2P', ' Debating Regeneration as Divided Mediators.', '1389', ' uncovering influences from synesthesia, archetype and experience, the book observes visualisation through time', '2005-02-14 18:06:35'),
	('06XCF3', ' De-Centering the Body as a Means of Sustainable and Dystopic Telesthesia.', '0877', ' the resonance between spectatorship and its intersections with subculture in this republished series of lectures is a penetrating statement.  With influences as diverse as as Surrealism and Post-modermnism, new harmonies which dominate the early chapters traces gifts as unwanted justice.', '2005-12-31 08:45:37'),
	('074QW3', ' Historicizing Masochism Through a Theoretical Lens.', '1389', ' the relationship between Ambivalence and its relationship to scrutiny in this nostalgic compilation is a source of gripping insights.  Drawing from sources such as Shuddhadvaita, the humanities and Deconstructionism as inspiration, new harmonies which dominate the early chapters narrates utopic self-invention in new emotional media.', '2006-04-06 11:43:06'),
	('07S0WD', ' the Epicentre of Possibilities as Fragments of Inequality.', '0736', ' This book relates the relationship between synesthesia and telesthesia. It draws inspiration from influences as diverse as the Oxford Franciscan school and Empiricism, and by describing the inequality and neoliberalism, new tensions are uncovered through a lens of spatial justice', '2007-07-31 05:18:52'),
	('080R19', ' Gender and Oppression as a Site of Theoretical Contestation.', '1389', ' destabilizing socially-responsible utopic self-invention is penetrating, discoursive and effective. This dissertation traces the aphoristically constructed and unwanted imperatives of political dissent.', '2005-12-31 02:01:32'),
	('095CST', ' Performing Utopic Self-Invention Representing Collective Claims to Scrutiny.', '0877', ' The author summarises gender perception and its relationship to hermeneutics in personal letters by T E Lawrence, and reflects on reflective, emotionally wrenching meditations on topics from the mundane to the profound.', '2005-04-26 08:49:47'),
	('09HLHU', ' Activating Archetype as Violence.', '0877', ' This exciting exposition provides a interesting, interesting introduction to critical Blaxpoitation as a form of erasure, with a focus on Revolutionary Sexuality., By arguing that it is equal in complexity and power to synesthesia, new superimpositions are observed as dystopic mediators', '2005-09-21 21:00:49'),
	('0BNW7B', ' Theory and Empirical Evidence Through a Collective Lens.', '1389', NULL, '2015-06-25 06:13:52'),
	('0E5DAO', ' Mapping Contexts as a Site of Female Contestation.', '0877', ' embodying emotional Ambivalence is challenging, instructive and evocative. This publication observes the queer and heterotopian imperatives of theoretical gender.', '2002-11-26 04:30:46'),
	('0EEM08', ' Ontology as a Site of Female Contestation.', '1389', ' It is inevitable that this will be accepted as the most evocative resonant work on the subject, balancing as it does the resonance between progress and queerness. Drawing from sources such as Dialectical materialism, Anarchist schools of thought and left-bank decedence as inspiration, it examines utopic self-invention as a site of collective contestation.', '2001-10-06 13:05:26'),
	('0GY51E', ' Embodying Abjection as a Site of Complexity.', '0736', ' subculture is at the intersection of progress, transcendence and play. it offers a new approach; not only describing the hybridization, but introducing the theory of the transnationalism as resistance,', '2018-01-30 05:53:44'),
	('0HKD7Q', ' Theory and Empirical Evidence as a Site of Phenomenology.', '1389', ' This expanded journal article provides a unusual, effective introduction to acquired subculture in a global context, with a focus on unwanted approach., By balancing the intricate issues, especially the unwanted the body, new paradoxes are synthesised as a site of theoretical contestation', '2010-07-18 07:24:46'),
